    std::regex markdownRegex(R"((?:^|\n)(?:(?:^|\n)#+\s+)(.*?)(?:\n|$))");

    // Initialize the output string
    std::string html;

    // Iterate through the markdown elements
    for (std::sregex_iterator it(markdown.begin(), markdown.end(), markdownRegex), end; it != end; ++it) {
        // Extract the markdown element
        std::smatch match = *it;
        std::string element = match.str(1);

        // Handle different markdown elements
        if (element[0] == '#') {
            // Convert headers to HTML
            html += "<h" + std::to_string(element.length()) + ">" + element.substr(1) + "</h" + std::to_string(element.length()) + ">\n";
        } else if (element[0] == '-') {
            // Convert horizontal rules to HTML
